export const COLUMNS = [
  {
    Header: 'List of Patients',
    columns: [
      {
        Header: 'ID',
        accessor: 'id',
      },
      {
        Header: 'First Name',
        accessor: 'first_name',
      },
      {
        Header: 'Last Name',
        accessor: 'last_name',
      },
      {
        Header: 'Email',
        accessor: 'last_name',
      },
      {
        Header: 'Sex',
        accessor: 'sex',
      },
      {
        Header: 'Creation Date',
        accessor: 'created_at',
      },
    ],
  },
];
